import { DeleteProdutoComponent } from './components/delete-produto/delete-produto.component';

@NgModule({
  declarations: [
    AppComponent,
    CadastroProdutoComponent,
    LerProdutosComponent,
    UpdateProdutoComponent,
    DeleteProdutoComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    HttpClientModule,
    FormsModule
  ],
  providers: [],
  bootstrap: [AppComponent]
})
